import React, {useRef, useEffect, useState} from "react";

function Lines({group, onSelect }) {
  const larges = [0];
  const cells = [0];
  let listRef = useRef();
  const [selectedItem, setSelectedItem] = useState(null);

  const [open, setOpen] = useState(false);
  useEffect(() => {

    
    let handler = (e) => {
      if (listRef.current && !listRef.current.contains(e.target)) {
        setSelectedItem(null);
      }
    }; 

    document.addEventListener("mousedown", handler);

    return() => {
      document.removeEventListener("mousedown", handler);
    }
    
  }, []); 

  const queueTypes = [
    { level: "Priority", type: "priority" },
    { level: "Reorder", type: "reorder" },
    { level: "Backstock", type: "backstock" },
  ];

  const displayList = (e) => {
    const target = e.target.parentElement;

    // if (target.classList.contains("dropdown")) {
    //   if (target.classList.contains("visible")) target.classList.remove("visible");
    //   else target.classList.add("visible");
    // }

    // if (open === false) {
    //   if (target.classList.contains("visible")) target.classList.remove("visible");
    // } else if (open === true) {
    //   target.classList.add("visible");
    // }
  };

  const handleClick = (e, queuetype) => {
    e.stopPropagation();
    setSelectedItem((prevDropdown) => (prevDropdown === queuetype ? null : queuetype));
    // console.log(e.target.parentElement);
  }



    const preventClose = (e) => {
      e.stopPropagation(); // Prevent the dropdown from closing when clicking inside the ul.lines
    };
  

  const handleSelect = (e, level) => {
    const target = e.target.parentElement;
    const value = e.target.value;
    if (target.classList.contains("selected")) {
      target.classList.remove("selected");
    } else {
      target.classList.add("selected");
    }
    onSelect(level, e.target.checked, value);
  };

  if (group === "Larges") {
    for (let i = 0; i < 7; i++) {
      larges.push(
        <li key={i}>
          <input
            type="checkbox"
            value={i}
            onClick={(e) => handleSelect(e, "Larges")}
          />
          {i + 1}
        </li>
      );
    }

    return (
      <div className="container" ref={listRef}>
        {queueTypes.map((queue, index) => (
          <div id={queue.type} className="list" key={queue.type} >
          <div onClick={(e) => {handleClick(e, queue.type)}} className={`dropdown ${selectedItem === queue.type ? 'visible' : 'hidden'}`}>
              <span className="anchor">{queue.level}</span>
              <ul className="lines" onClick={preventClose}>
                {larges.map((item, index) => (
                  <li key={index}>
                    <input
                      type="checkbox"
                      value={index}
                      onClick={(e) => handleSelect(e, queue.level)}
                    />
                    {index === 0 ? "All" : index}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        ))}
      </div>
    );
  }

  if (group === "Cells") {
    for (let i = 0; i < 14; i++) {
      cells.push(
        <li key={i}>
          <input
            type="checkbox"
            value={i}
            onClick={(e) => handleSelect(e, "Cells")}
          />
          {i === 0 ? "All" : i}
        </li>
      );
    }

    return (
      <div  className="container" ref={listRef}>
        {queueTypes.map((queue) => (
          <div id={queue.type} className="list" key={queue.type} >
          <div onClick={(e) => {handleClick(e, queue.type)}} className={`dropdown ${selectedItem === queue.type ? 'visible' : 'hidden'}`}>
              <span className="anchor">{queue.level}</span>
              <ul className="lines" onClick={preventClose}>
                {cells.map((item, index) => (
                  <li key={index}
                  value={index}
                  onClick={(e) => handleSelect(e, queue.level)}>
                    <input
                      type="checkbox"
                      value={index}
                    />
                    {index === 0 ? "All" : index}
                  </li>
                ))}
              </ul>
            </div>
          </div>
        ))}
      </div>
    );
  }
}

export default Lines;
